package cn.collectionmap.test;

public class letter {
	private String name;
	private int count;
	
	public letter() {
		// TODO Auto-generated constructor stub
	}
	
	public letter(String name, int count) {
		super();
		this.name = name;
		this.count = count;
	}

	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public int getCount() {
		return count;
	}
	public void setCount(int count) {
		this.count = count;
	}
	
	
}
